xmax = [ xmax1 xmax2 xmax3 xmax4 xmax5 xmax6 ];
xmin = [ xmin1 xmin2 xmin3 xmin4 xmin5 xmin6 ];

ymax = [ ymax2 ymax2 ymax1 ymax1 ymax1 ymax1 ];
ymin = [ ymin2 ymin2 ymin1 ymin1 ymin1 ymin1 ];

end

%% Geração pseudo-aleatória de indivíduos da população inicial

if ncond == 1
    popx1 = xmin1+rand(nind-1,(nvar/4))*(xmax1-xmin1); 
    popx2 = xmin2+rand(nind-1,(nvar/4))*(xmax2-xmin2);

elseif ncond == 2
    
    popx1 = xmin1+rand(nind-1,(nvar/2)/3)*(xmax1-xmin1);
    popx2 = xmin2+rand(nind-1,(nvar/2)/3)*(xmax2-xmin2);
    popx3 = xmin3+rand(nind-1,(nvar/2)/3)*(xmax3-xmin3);

elseif ncond == 3
    popx1 = xmin1+rand(nind-1,((nvar-1)/3)/3)*(xmax1-xmin1);
    popx2 = xmin2+rand(nind-1,((nvar-1)/3)/3)*(xmax2-xmin2);
    popx3 = xmin3+rand(nind-1,((nvar-1)/3)/3)*(xmax3-xmin3);
    popx4 = xmin4+rand(nind-1,((nvar-1)/3)/3)*(xmax4-xmin4);
    popx5 = xmin5+rand(nind-1,((nvar-1)/3)/3)*(xmax5-xmin5);

elseif ncond == 4
    popx1 = xmin1+rand(nind-1,(nvar/4)/3)*(xmax1-xmin1);
    popx2 = xmin2+rand(nind-1,(nvar/4)/3)*(xmax2-xmin2);
    popx3 = xmin3+rand(nind-1,(nvar/4)/3)*(xmax3-xmin3);
    popx4 = xmin4+rand(nind-1,(nvar/4)/3)*(xmax4-xmin4);
    popx5 = xmin5+rand(nind-1,(nvar/4)/3)*(xmax5-xmin5);
    popx6 = xmin6+rand(nind-1,(nvar/4)/3)*(xmax6-xmin6);
end

%% Condicionante que faz com que a primeira população sempre seja formada pela configuração original dos condutores:

%TH: Utilizando as configurações que estão no meu trabalho

if ncond == 1
    popx = [ 0 3; popx1 popx2 ]; %matriz população inicial posição x
    popy = ymin1+rand(nind-1,(nvar/2))*(ymax1-ymin1);
    popy = [ 14.01 14.01; popy ]; %matriz população inicial posição y

elseif ncond == 2
    popx = [ 0.1140 10.136 10.364; popx1 popx2 popx3 ];
    popy = ymin1+rand(nind-1,(nvar/2))*(ymax1-ymin1);
    popy = [ 14.29 14.29 14.29; popy];

elseif ncond == 3
    popx  = [ 0 0.228 10.021 10.25 10.478; popx1 popx2 popx3 popx4 popx5 ];
    popy1 = ymin1+rand(nind-1,(nvar/2))*(ymax1-ymin1);
    popy  = [ 16.758 16.530 16.530 16.758 16.530; popy1 ];

elseif ncond == 4
    popx  = [ 0.475 0.475 7.025 7.025 7.975 7.975; popx1 popx2 popx3 popx4 popx5 popx6 ];     
    popy1 = ymin1+rand(nind-1,(nvar/2)-2)*(ymax1-ymin1);
    popy2 = ymin2+rand(nind-1,(nvar/2)-4)*(ymax2-ymin2);
    popy  = [ 25.95 25 18.45 17.5 18.45 17.5; popy2 popy1 ];
end

pop = [ popx popy ]; %armazena a população inicial

%% Avaliação de restrições para cada indivíduo da população inicial

[popL,popC] = size(pop); %armazena em duas variáveis o tamanho das linhas e colunas da matriz população

popE = zeros(nind,100);

for i = 1:nind

    P = pop(i,1:end); %pega cada uma das configurações da pop inicial dos indiv gerados
    [E] = fcn_restricoes(P,V,r,dmin,Dmin); %insere elas na função de avaliação de restrições/penalidades com respectivo dmin
    popE(i,:) = E; %armazena o campo elétrico gerado para cada uma das configurações da pop inicial
    
end

%% Seleção de indivíduos da população inicial

maxpopE = zeros(nind,1);

for k = 1:nind
    maxpopE(k,1) = max(popE(k,:)); 
    %preenche a matriz 100x1 gerada anteriormente com os 
    %máximos valores de campo elétrico para cada config

end

[minpopE,ind] = min(maxpopE); 
%armazena em duas variáveis o mínimo valor de campo elétrico 
%da matriz de máximos E e qual é este indiv

bestind = ind; %seleciona este indiv que foi armazenado anteriormente 

for n1 = 1:nvar
    bestindpos(1,n1) = pop(bestind,n1); %busca as posições x e y do indiv com o menor campo elétrico máximo

end

%% Armazena a população inicial

armazenapop = zeros(ngen,nvar); 
%cria uma matriz nº de gerações X nº de posições (x,y) dos condutores

armazenapop = [ popx(1,:) popy(1,:) ; armazenapop ]; 
%matriz que armazena as posições dos indivíduos gerado 
%tendo os valores das posições originais na primeira linha
 
%% Aplicação do DE nas populações geradas

for ng = 1:ngen %inicia a montagem de uma nova população
    
    %Critério de parada inserido em 19/03/2021
%     ans1 = round(maxpopE(nind-5,1)*100)/100 == round(maxpopE(nind-4,1)*100)/100;
%     ans2 = round(maxpopE(nind-5,1)*100)/100 == round(maxpopE(nind-3,1)*100)/100;
%     ans3 = round(maxpopE(nind-5,1)*100)/100 == round(maxpopE(nind-2,1)*100)/100;
%     ans4 = round(maxpopE(nind-5,1)*100)/100 == round(maxpopE(nind-1,1)*100)/100;
%     ans5 = round(maxpopE(nind-5,1)*100)/100 == round(maxpopE(nind,1)*100)/100; 
%     ans6 = round(maxpopE(nind-4,1)*100)/100 == round(maxpopE(nind-3,1)*100)/100;
%     ans7 = round(maxpopE(nind-4,1)*100)/100 == round(maxpopE(nind-2,1)*100)/100;
%     ans8 = round(maxpopE(nind-4,1)*100)/100 == round(maxpopE(nind-1,1)*100)/100;
%     ans9 = round(maxpopE(nind-4,1)*100)/100 == round(maxpopE(nind,1)*100)/100;
%     ans10 = round(maxpopE(nind-3,1)*100)/100 == round(maxpopE(nind-2,1)*100)/100;
%     ans11 = round(maxpopE(nind-3,1)*100)/100 == round(maxpopE(nind-1,1)*100)/100;
%     ans12 = round(maxpopE(nind-3,1)*100)/100 == round(maxpopE(nind,1)*100)/100;
%     ans13 = round(maxpopE(nind-2,1)*100)/100 == round(maxpopE(nind-1,1)*100)/100;
%     ans14 = round(maxpopE(nind-2,1)*100)/100 == round(maxpopE(nind,1)*100)/100;
%     ans15 = round(maxpopE(nind-1,1)*100)/100 == round(maxpopE(nind,1)*100)/100;
%     
%     if ans1==1 && ans2==1 && ans3==1 && ans4==1 && ans5==1 && ans6==1 && ans7==1 && ans8==1 && ans9==1 && ans10==1 && ans11==1 && ans12==1 && ans13==1 && ans14==1 && ans15==1
%         break
%     end

%    F = 0.90; %geralmente de 0.4 a 1 de acordo com Lin
    
    %MUTAÇÃO
    selec = randperm(nind); %seleciona valores aleatórios dentro os nº de individuos (100 neste caso)
    
    pop2 = zeros(popL,popC); %gera uma segunda matriz para armazenar a população filha
    
    for n1 = 1:nind %constante de 1 até o nº total de indiv
       
        nF = 2; %geralmente de 2 a 4 de acordo com Lin
        F = 1 - 0.6*(minpopE/maxpopE(n1,1))^(1/nF); %fator de escala de mutação, passo do novo vetor
        
        a = n1+1; %constante +1
        b = n1+2; %constante +2
        c = n1+3; %constante +3
        
        if a > nind %se dentro desta aleatoriedade e dentro do enquanto o valor de a for maior que o do indiv selecionado
            a = 1; % variavel a armazena 1
        end
        if b > nind %se dentro desta aleatoriedade e dentro do enquanto o valor de b for maior que o do indiv selecionado
            b = b-nind; % variavel b armazena ela mesma menos o indiv selecionado
        end
        if c > nind %se dentro desta aleatoriedade e dentro do enquanto o valor de c for maior que o do indiv selecionado
            c = c-nind; % variavel c armazena ela mesma menos o indiv selecionado
        end
        
        for n2 = 1:nvar %contador de 1 até posições x e y (componentes)
            popdif(n1,n2) = (pop(selec(a),n2)-pop(selec(b),n2))*F; %tirei *rand(1) porque não consta na bibliografia
            %armazena dentro de uma matriz de tamanho da matriz pop uma
            %nova matriz de pop com a diferenciação entre duas gerações
            %multiplicada por constantes pré-estabelecidas
            
            popruido(n1,n2) = popdif(n1,n2)+pop(selec(c),n2);
            %armazena dentro de uma matriz de tamanho da matriz pop uma
            %nova matriz de pop somando um terceiro indiv no resultado
            %anterior, desta forma a mutação é realizada
            
            %CRUZAMENTO
            
            %armazena um valor aleatório até o inteiro 1 numa matriz 1x1
            kcruz = rand(1); %fator de cruzamento
            
            if kcruz > 0.60 %por que é este valor?
                pop2(n1,n2) = popruido(n1,n2); %é armazenada na pop filha a mutação gerada anteriomente
            else
                pop2(n1,n2) = pop(selec(n1),n2); %senão é armazenado um valor da pop original
            end
            
            %Substitui os valores que ultrapassarem a região factível
            
            if n2 <= (nvar/2) %para a posição x dos condutores reais
                if pop2(n1,n2) > xmax(n2) %se algum indiv da pop filha for maior que x da região factível
                    pop2(n1,n2) = xmax(n2); %ela recebe o valor de xmax da restrição
                end
                
                if pop2(n1,n2) < xmin(n2) %se algum indiv da pop filha for menor que x da região factível
                    pop2(n1,n2) = xmin(n2);%ela recebe o valor de xmin da restrição
                end
            end
            
            if n2 > (nvar/2) %para a posição y dos condutores reais
                for i = 1:(nvar/2)  %preenche todas as posições do vetor
                    if pop2(n1,n2) > ymax(i) %se algum indiv da pop filha for maior que y da região factível
                    	pop2(n1,n2) = ymax(i); %ela recebe o valor de xmax da restrição
                    end
                    if pop2(n1,n2) < ymin(i) %se algum indiv da pop filha for menor que y da região factível
                        pop2(n1,n2) = ymin(i); %ela recebe o valor de xmin da restrição
                    end
                end
            end
            
        end
        
    end
    
    Q1 = pop2; %armazena as posições da pop filha gerada
    
    pop2E = zeros(nind,100); %cria uma matriz linhas nº de indiv e 100 colunas = 100x100
    
    for i = 1:nind %contador de 1 até nº de indiv = 100

        Q1 = pop2(i,1:end); %armazena num vetor Q1 a transposta do vetor posições pop filha
        [E2,armazenarest] = fcn_restricoes(Q1,V,r,dmin,Dmin); %insere elas na função de avaliação de restrições/penalidades com respectivo dmin
        pop2E(i,:) = E2; %armazena o campo elétrico gerado para cada uma das configurações da pop filha
        
    end
    
    %SELEÇÃO
    
    maxpop2E = zeros(nind,1); %cria um vetor tamanho nº de indiv em 1 coluna = 100x1
    
    for k = 1:nind %contador de 1 até nº de indiv = 100
        %armazena no vetor criado anteriomente os valores máximos de campo elétrico das config pop filha
        maxpop2E(k,1) = max(pop2E(k,:));
    end
    
    for ne = 1:nind %contador de 1 até nº de indiv = 100
        if maxpopE(ne,1) < maxpop2E(ne,1) 
        %comparação entre os máximos campo elétrico da pop original e pop filha (pop origi < pop filha)
            for nv = 1:nvar %contador de 1 até as posições x e y
                pop2(ne,nv) = pop(ne,nv); %armazena na matriz posição pop filha os valores da posição pop origi que estão menores
                %melhores indiv já selecionados antes deste for pop filha
                maxpop2E(ne,1) = maxpopE(ne,1); %armezena na matriz campo elétrico máximos filha os valores menores pop origi
            end
        end
    end
    
    [minpop2E,ind2] = min(maxpop2E); %armazena o menor valor de campo elétrico da pop filha e a posição deste indiv
	
     %Seleciona o melhor individuo para qualquer dos 3 problemas
    if minpop2E < minpopE %caso o campo elétrico mínimo da pop origi for maior que a da pop filha
        bestind = ind2; %o melhor indiv passa a ser o da pop filha
        minpopE = minpop2E; %e o campo elétrico do mesmo
      
        for n1 = 1:nvar %contador 1 até posições x e y
            bestindpos(1,n1) = pop2(bestind,n1); %armazena as posições do melhor indiv
        end
    end
    
    armazenapop(ng+1,1:nvar) = bestindpos; %armazena as posições sugeridas em cada uma das gerações
    
    maxpopE = maxpop2E; %armazena os campos elétricos gerados para pop filha na pop origi
    pop = pop2; %armazena as posições da pop filha na pop origi
    clear pop2 %limpa a matriz posições pop filha
    ab(ng+1) = minpopE; %armazena os valores mínimos sugeridos numa nova matriz ab de 102 valores
    
end

